import React from 'react';
import { makeStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";
import { Header } from '../../components/header/Header';
import { SideBarSearch } from './../../components/sidebarSearch/SidebarSearch';
import { Mess } from './../../components/sidebar/Mess';
import { Post } from '../../components/post/Post';
import { Container } from '@material-ui/core';
import { PeopleSearch } from '../../components/peopleSearch/PeopleSearch.js';
import ImageList from './../../components/imageList/ImageList.js'
import FriendList from '../../components/friendList/FriendList';
import RestaurantNearMe from '../../components/restaurantNearMe/RestaurantNearMe';
const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1
    },
    nonePadding: {
        padding: "0!important"
    },
    people: {
        marginTop: '100px'
    },
    title: {
        fontSize: 16,
        fontWeight: 'bold'
    },
    iconMessage: {
        textAlign: 'center',
        paddingTop: '35px'
    }
}));

export function Search() {
    const classes = useStyles();
    var avatarImg = "https://chatscope.io/storybook/react/static/media/zoe.e31a4ff8.svg";
    return (
        <Container>
            <Grid container spacing={3} >
                <Grid item xs={12} className={classes.nonePadding}>
                    <Header></Header>
                </Grid>
                <Grid item xs={2}>
                    <SideBarSearch></SideBarSearch>
                </Grid>
                <Grid item xs={7} className={classes.people}>
                    <PeopleSearch></PeopleSearch>
                    <br></br>
                    <PeopleSearch></PeopleSearch>
                    <br></br>
                    <PeopleSearch></PeopleSearch>
                    <br></br>
                    <PeopleSearch></PeopleSearch>
                    {/* <Post></Post>
                    <Post></Post> */}
                    <ImageList></ImageList>
                    <FriendList></FriendList>
                    <RestaurantNearMe></RestaurantNearMe>
                </Grid>
                <Grid item xs={3}>
                    <Mess></Mess>
                </Grid>
            </Grid>
        </Container>
    );
}
